begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(139140776647863377138)
,p_plugin_type=>'REGION TYPE'
,p_name=>'APEX.D3.DASHBOARD.CHARTS'
,p_display_name=>'APEX D3 Dashboard Charts'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION SQL_TO_SYS_REFCURSOR (',
'    P_IN_SQL_STATEMENT   CLOB,',
'    P_IN_BINDS           SYS.DBMS_SQL.VARCHAR2_TABLE',
') RETURN SYS_REFCURSOR AS',
'    VR_CURS         BINARY_INTEGER;',
'    VR_REF_CURSOR   SYS_REFCURSOR;',
'    VR_EXEC         BINARY_INTEGER;',
'/* TODO make size dynamic */',
'    VR_BINDS        VARCHAR(100);',
'BEGIN',
'    VR_CURS         := DBMS_SQL.OPEN_CURSOR;',
'    DBMS_SQL.PARSE(',
'        VR_CURS,',
'        P_IN_SQL_STATEMENT,',
'        DBMS_SQL.NATIVE',
'    );',
'    IF P_IN_BINDS.COUNT > 0 THEN',
'        FOR I IN 1..P_IN_BINDS.COUNT LOOP',
'        /* TODO find out how to prevent ltrim */',
'            VR_BINDS   := LTRIM(',
'                P_IN_BINDS(I),',
'                '':''',
'            );',
'            DBMS_SQL.BIND_VARIABLE(',
'                VR_CURS,',
'                VR_BINDS,',
'                V(VR_BINDS)',
'            );',
'        END LOOP;',
'    END IF;',
'',
'    VR_EXEC         := DBMS_SQL.EXECUTE(VR_CURS);',
'    VR_REF_CURSOR   := DBMS_SQL.TO_REFCURSOR(VR_CURS);',
'    RETURN VR_REF_CURSOR;',
'EXCEPTION',
'    WHEN OTHERS THEN',
'        IF DBMS_SQL.IS_OPEN(VR_CURS) THEN',
'            DBMS_SQL.CLOSE_CURSOR(VR_CURS);',
'        END IF;',
'        RAISE;',
'END;',
'',
'FUNCTION F_AJAX (',
'    P_REGION   IN         APEX_PLUGIN.T_REGION,',
'    P_PLUGIN   IN         APEX_PLUGIN.T_PLUGIN',
') RETURN APEX_PLUGIN.T_REGION_AJAX_RESULT IS',
'    VR_RESULT       APEX_PLUGIN.T_REGION_AJAX_RESULT;',
'    VR_CUR          SYS_REFCURSOR;',
'    VR_BIND_NAMES   SYS.DBMS_SQL.VARCHAR2_TABLE;',
'BEGIN',
'/* undocumented function of APEX for get all bindings */',
'    VR_BIND_NAMES   := WWV_FLOW_UTILITIES.GET_BINDS(P_REGION.SOURCE);',
'',
'/* execute binding*/',
'    VR_CUR          := SQL_TO_SYS_REFCURSOR(',
'        RTRIM(',
'            P_REGION.SOURCE,',
'            '';''',
'        ),',
'        VR_BIND_NAMES',
'    );',
'',
'/* create json */',
'    APEX_JSON.OPEN_OBJECT;',
'    APEX_JSON.WRITE(',
'        ''row'',',
'        VR_CUR',
'    );',
'    APEX_JSON.CLOSE_OBJECT;',
'',
'/* does not support cursor */',
'--APEX_UTIL.JSON_FROM_SQL( SQLQ   => P_REGION.SOURCE );',
'    RETURN VR_RESULT;',
'END;',
'',
'FUNCTION F_RENDER (',
'    P_REGION                IN                      APEX_PLUGIN.T_REGION,',
'    P_PLUGIN                IN                      APEX_PLUGIN.T_PLUGIN,',
'    P_IS_PRINTER_FRIENDLY   IN                      BOOLEAN',
') RETURN APEX_PLUGIN.T_REGION_RENDER_RESULT IS',
'',
'    VR_RESULT         APEX_PLUGIN.T_REGION_RENDER_RESULT;',
'    VR_CONF_JSON      APEX_APPLICATION_PAGE_REGIONS.ATTRIBUTE_01%TYPE := P_REGION.ATTRIBUTE_01;',
'    VR_ITEMS2SUBMIT   APEX_APPLICATION_PAGE_REGIONS.AJAX_ITEMS_TO_SUBMIT%TYPE := APEX_PLUGIN_UTIL.PAGE_ITEM_NAMES_TO_JQUERY( P_REGION.AJAX_ITEMS_TO_SUBMIT );',
'    VR_THEME_SELECT   VARCHAR2(20) := P_PLUGIN.ATTRIBUTE_01;',
'    VR_THEME_NAME     VARCHAR2(30) := NULL;',
'BEGIN',
'    CASE',
'        WHEN VR_THEME_SELECT = ''INSIGHT'' THEN',
'            VR_THEME_NAME   := ''d3dashbord-insight.pkgd.min'';',
'        WHEN VR_THEME_SELECT = ''GRAPH'' THEN',
'            VR_THEME_NAME   := ''d3dashbord-graph.pkgd.min'';',
'        ELSE',
'            VR_THEME_NAME   := ''d3dashbord.pkgd.min'';',
'    END CASE;',
'',
'    APEX_CSS.ADD_FILE(',
'        P_NAME        => VR_THEME_NAME,',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => VR_THEME_NAME',
'    );',
'',
'    APEX_JAVASCRIPT.ADD_LIBRARY(',
'        P_NAME        => ''d3dashbord.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''d3dcjssrc''',
'    );',
'',
'    HTP.P(''<div class="d3dc-root"></div>'');',
'    APEX_JAVASCRIPT.ADD_ONLOAD_CODE(''apexDashboardChart.initialize('' ||',
'    APEX_JAVASCRIPT.ADD_VALUE( P_REGION.STATIC_ID, TRUE ) ||',
'    APEX_JAVASCRIPT.ADD_VALUE( APEX_PLUGIN.GET_AJAX_IDENTIFIER, TRUE ) ||',
'    APEX_JAVASCRIPT.ADD_VALUE( P_REGION.NO_DATA_FOUND_MESSAGE, TRUE ) ||',
'    APEX_JAVASCRIPT.ADD_VALUE( VR_CONF_JSON, TRUE ) ||',
'    APEX_JAVASCRIPT.ADD_VALUE( VR_ITEMS2SUBMIT, TRUE ) ||',
'    APEX_JAVASCRIPT.ADD_VALUE( P_REGION.ESCAPE_OUTPUT, FALSE ) || '');'');',
'',
'    RETURN VR_RESULT;',
'END;'))
,p_api_version=>1
,p_render_function=>'F_RENDER'
,p_ajax_function=>'F_AJAX'
,p_standard_attributes=>'SOURCE_SQL:AJAX_ITEMS_TO_SUBMIT:NO_DATA_FOUND_MESSAGE:ESCAPE_OUTPUT'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'Create with only one SQL statement one or more D3 charts with different configurations and different chart types. Possible are among other things: Bar, line, area, pie, gauge, donut, step and stack charts.',
'',
'The SQL statement is divided into 3 cursors:',
'1. configuration for a certain chart',
'2. the definition of sera, colours and chart type',
'3. the data of the respective series',
'',
'All things such as chart type, number of series, colors, size, data points and chart configurations can be adjusted at runtime by the SQL statement and reset again and again by refresh. Examples can be found in the Sample App:',
'',
'https://apex.oracle.com/pls/apex/f?p=103428'))
,p_version_identifier=>'1.0.4'
,p_about_url=>'https://github.com/RonnyWeiss/APEX-D3-Dashboard-Charts'
,p_files_version=>2058
);
