wwv_flow_api.create_plugin_std_attribute(
 p_id=>wwv_flow_api.id(92112852402262493440)
,p_plugin_id=>wwv_flow_api.id(139140776647863377138)
,p_name=>'SOURCE_SQL'
,p_default_value=>wwv_flow_string.join(wwv_flow_t_varchar2(
'WITH',
'CHART AS (SELECT ROWNUM AS CHART_ID, ROUND(DBMS_RANDOM.VALUE(1,8)) AS CHART_TYPE FROM DUAL CONNECT BY ROWNUM <= (TO_NUMBER(TO_CHAR(SYSDATE, ''SS''))/10+2)),',
'SERIES AS (SELECT ROWNUM AS SERIES_ID FROM DUAL CONNECT BY ROWNUM <= 4)',
'SELECT',
'    CURSOR (',
'        SELECT',
'            ''CHART_'' || CHART_ID AS CHART_ID,',
'            ''Chart '' || ROWNUM AS TITLE,',
'            6 AS COLSPAN,',
'            350 AS HEIGHT_CHART,',
'            20 AS HEIGHT_XAXIS,',
'            ''category'' AS X_TYPE',
'        FROM',
'            CHART',
'    ) AS CONFIG,',
'    CURSOR (',
'        SELECT',
'            ''CHART_'' || CHART_ID AS CHART_ID,',
'            ''SERIES_'' || SERIES_ID AS SERIES_ID,',
'            ''Serie '' || SERIES_ID AS LABEL,',
'            DECODE(CHART_TYPE,1,''pie'',2,''area'',3,''bar'',4,''bubble'',5,''donut'',6,''radar'',7,''scatter'',NULL) AS TYPE',
'        FROM',
'             SERIES JOIN CHART ON 1=1 ',
'    ) AS SERIES,',
'    CURSOR (',
'        SELECT',
'            ''CHART_'' || CHART_ID AS CHART_ID,',
'            ''SERIES_'' || SERIES_ID AS SERIES_ID,',
'            X,',
'            Y',
'        FROM',
'            (',
'                SELECT',
'                    ''Value '' || ROWNUM AS X,',
'                    ROUND(',
'                        DBMS_RANDOM.VALUE(',
'                            1,',
'                            100',
'                        )',
'                    ) AS Y',
'                FROM',
'                    DUAL',
'                CONNECT BY',
'                    ROWNUM <= 20',
'            )',
'            JOIN CHART ON 1=1 JOIN SERIES ON 1=1',
'    ) AS DATA',
'FROM',
'    DUAL'))
,p_depending_on_has_to_exist=>true
,p_examples=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<h2>Gauges</h2>',
'<pre>',
'SELECT',
'CURSOR (',
'	SELECT',
'		ROWNUM AS CHART_ID,',
'		''Gauge Chart '' || ROWNUM AS TITLE,',
'		3 AS COLSPAN,',
'		120 AS HEIGHT_CHART,',
'		1 AS PADDING_BOTTOM,',
'		''indexed'' AS X_TYPE',
'	FROM',
'		DUAL',
'	CONNECT BY',
'		ROWNUM <= 12',
') AS CONFIG,',
'CURSOR (',
'	SELECT',
'		ROWNUM AS CHART_ID,',
'		''SERIES_1'' AS SERIES_ID,',
'		''Serie 1'' AS LABEL,',
'		''gauge'' AS TYPE',
'	FROM',
'		DUAL',
'	CONNECT BY',
'		ROWNUM <= 12',
') AS SERIES,',
'CURSOR (',
'	SELECT',
'		ROWNUM AS CHART_ID,',
'		''SERIES_1'' SERIES_ID,',
'		''Value '' || ROWNUM AS X,',
'		ROUND(',
'			DBMS_RANDOM.VALUE(',
'				0,',
'				100',
'			)',
'		) AS Y',
'	FROM',
'		DUAL',
'	CONNECT BY',
'		ROWNUM <= 12',
') AS DATA',
'FROM',
'DUAL',
'</pre>',
'<h2>TimeSeries Chart</h2>',
'<pre>',
'WITH',
'CHART AS (SELECT ROWNUM AS CHART_ID, ROUND(DBMS_RANDOM.VALUE(1,5)) AS CHART_TYPE FROM DUAL CONNECT BY ROWNUM <= 2),',
'SERIES AS (SELECT ROWNUM AS SERIES_ID FROM DUAL CONNECT BY ROWNUM <= 4)',
'SELECT',
'    CURSOR (',
'        SELECT',
'            ''CHART_'' || CHART_ID AS CHART_ID,',
'            ''Chart '' || ROWNUM AS TITLE,',
'            12 AS COLSPAN,',
'            400 AS HEIGHT_CHART,',
'            20 AS HEIGHT_XAXIS,',
'            ''timeseries'' AS X_TYPE',
'        FROM',
'            CHART',
'    ) AS CONFIG,',
'    CURSOR (',
'        SELECT',
'            ''CHART_'' || CHART_ID AS CHART_ID,',
'            ''SERIES_'' || SERIES_ID AS SERIES_ID,',
'            ''Serie '' || SERIES_ID AS LABEL,',
'            DECODE(CHART_TYPE,1,''area'',2,''bar'',3,''bubble'',4,''scatter'',NULL) AS TYPE',
'        FROM',
'             SERIES JOIN CHART ON 1=1 ',
'    ) AS SERIES,',
'    CURSOR (',
'        SELECT',
'            ''CHART_'' || CHART_ID AS CHART_ID,',
'            ''SERIES_'' || SERIES_ID AS SERIES_ID,',
'            X,',
'            Y',
'        FROM',
'            (',
'                SELECT',
'                    TO_CHAR(SYSDATE-ROWNUM/24, ''YYYY-MM-DD HH24:MI:SS'') AS X,',
'                    ROUND(',
'                        DBMS_RANDOM.VALUE(',
'                            1,',
'                            100',
'                        )',
'                    ) AS Y',
'                FROM',
'                    DUAL',
'                CONNECT BY',
'                    ROWNUM <= 12',
'            )',
'            JOIN CHART ON 1=1 JOIN SERIES ON 1=1',
'    ) AS DATA',
'FROM',
'    DUAL',
'</pre>'))
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<h4>The source statement consists of 3 cursors:',
'<br>',
'<br>',
'<ul>',
'<li>CONFIG: Loads the configuration for the charts</li>',
'<li>SERIES: Defines the series with their attributes</li>',
'<li>DATA: contains the data values</li>',
'</ul>',
'<br>The Config(s), Series(s), Data are assigned via the <b>CHART_ID</b> column. Each CHART_ID is a new chart.',
'<br>A simple example is this statement:',
'</h4>',
'<pre>',
'SELECT',
' CURSOR (',
'  SELECT',
'	/* ID that references the chart [alphanumeric] */',
'	1 AS CHART_ID,',
'	/* Title of the chart [string] */',
'	''Chart Title'' AS TITLE,',
'	/* width per chart between 1 and 12 [number] */',
'	12 AS COLSPAN,',
'	/* Add x grid lines [sqlboolean (1,0)] */',
'	1 AS GRID_X,',
'	/* Add y grid lines [sqlboolean (1,0)] */',
'	1 AS GRID_Y,',
'	/* Height of the chart [number] */',
'	400 AS HEIGHT_CHART,',
'	/* Bottom padding (height) of the x axis [number] */',
'	10 AS HEIGHT_XAXIS,',
'	/* Add legend to chart [sqlboolean (1,0)] */',
'	1 AS LEGEND_SHOW,',
'	/* Change the position of legend. Available values are: <b>bottom</b>, <b>right</b> and <b>inset</b> are supported [string] */',
'	''right'' AS LEGEND_POSITION,',
'	/* Padding on the bottom of chart [number] */',
'	40 AS PADDING_BOTTOM,',
'	/* Padding on the left of chart [number] */',
'	40 AS PADDING_LEFT,',
'	/* Padding on the right of chart [number] */',
'	120 AS PADDING_RIGHT,',
'	/* Padding on the top of chart [number] */',
'	10 AS PADDING_TOP,',
'	/* Rotate y and x axis [sqlboolean (1,0)] */',
'	0 AS ROTATEAXIS,',
'	/* Show or hide labels on each data points [sqlboolean (1,0)] */',
'	0 AS SHOWDATALABELS,',
'	/* Whether to show each point in line [sqlboolean (1,0)] */',
'	0 AS SHOWDATAPOINTS,',
'	/* Cut tick text after number of characters [number] */',
'	30 TICK_CUTAFTER,',
'	/* Set maximum number of tick texts on a axis [number] */',
'	15 AS TICK_MAXNUMBER,',
'	/* Show or hide tooltip [sqlboolean (1,0)] */',
'	1 AS TOOLTIP_SHOW,',
'	/* Set if tooltip is grouped or not for the data points [sqlboolean (1,0)] */',
'	1 AS TOOLTIP_GROUPED,',
'	/* Label of the x axis [string] */',
'	''X Axis'' AS X_LABEL,',
'	/* Set type of x axis. Available types are <b>indexed</b> own index is generated, <b>category</b> x values are taken from data set, <b>timeseries</b> dates are taken from data set <b>x.timeFormat</b> has to be set [string] */',
'	''category'' AS X_TYPE,',
'	/* Label of the y axis [string] */',
'	''Y Axis 1'' AS Y_LABEL,',
'	/* Set max range the y axis [number] */',
'	NULL AS Y_MAX,',
'	/* Set min range the y axis [number] */',
'	NULL AS Y_MIN,',
'	/* Label of the y2 axis [string] */',
'	''Y Axis 2'' AS Y2_LABEL,',
'	/* Set max range the y2 axis [number] */',
'	NULL AS Y2_MAX,',
'	/* Set min range the y2 axis [number] */',
'	NULL AS Y2_MIN,',
'	/* Enable or disable zoom [sqlboolean (1,0)] */',
'	1 AS ZOOM_ENABLED,',
'  FROM',
'	DUAL',
' ) AS CONFIG,',
' CURSOR (',
'  SELECT',
'	1 AS CHART_ID,',
'	/* ID that references the series [alphanumeric] */',
'	''SERIES_'' || ROWNUM AS SERIES_ID,',
'	/* ID that references the group [alphanumeric] */',
'	''GROUP_'' || ROWNUM AS GROUP_ID,',
'	/* label of the series [string] */',
'	''Serie '' || ROWNUM AS LABEL,',
'        /* set if y or y2 axis */',
'        ''y2'' AS Y_AXIS,',
'	/* type of the chart (bar, line, area, area-spline, bubble, donut, gauge, pie, radar, scatter, spline, step, area-step) [string] */',
'	''bar'' AS TYPE,',
'	/* link when point of series is clicked [string] */',
'	''https://github.com/RonnyWeiss'' AS LINK,',
'	 /* color of series [string] */',
'	''#60c5ff'' AS COLOR',
'  FROM',
'	DUAL',
') AS SERIES,',
' CURSOR (',
'   SELECT',
'	1 AS CHART_ID,',
'	''SERIES_1'' SERIES_ID,',
'	/* point of x axis if timeseries need to_chart in x.timeformat [string] */',
'	''Value '' || ROWNUM AS X,',
'	/* value of y axis [number] */',
'	ROUND(',
'		DBMS_RANDOM.VALUE(',
'			0,',
'			100',
'		)',
'	) AS Y',
'  FROM',
'	DUAL',
'  CONNECT BY',
'	ROWNUM <= 70',
') AS DATA',
'FROM',
'    DUAL',
'</pre>'))
);
end;
/
